import React from "react";

export default function Header() {
  const style = {
    display: "flex",
    justifyContent: "space-evenly",
    backgroundColor: "blue",
    height: "3em",
    color: "white",
  };
  const style2 = {
    display: "flex",
    justifyContent: "start",
    border: "1px solid black",
    width: "100%",
  };

  return (
    <header style={style}>
      <div style={style2}>
        <div>WE CART</div>
      </div>
      <div>
        <a href="">
          <button>Sell It</button>
        </a>
      </div>
    </header>
  );
}
